import React from 'react';

const Weather = (props)=> {


        return (
          <div>
            tempreature : {props.tempreature}
            city : {props.city}
            country : {props.country}
            humidity : {props.humidity}
            description : {props.description}
          </div>
        );

}

export default Weather;
